//       }, 10);
//     } else {
//       clearInterval(interval);
//     }
//     return () => clearInterval(interval);
//   }, [timerOn]);
    return (
        <div style={{ width: 200, height: 200 }}>
            <CircularProgressbar value={percentage} text={`${percentage}%`} />;
        </div>
    );
};

export default Timer;
